inline bool is_grid_blocked(MAP_GRID *grid)
{
    if (grid->x < 0 || grid->x >= MAP_GRID_XMAX) return true;
    if (grid->y < 0 || grid->y >= MAP_GRID_YMAX) return true;

    return gs_navi_data[grid->x][grid->y] != 0;
}

inline bool is_grid_blocked(int x, int y)
{
    if (x < 0 || x >= MAP_GRID_XMAX) return true;
    if (y < 0 || y >= MAP_GRID_YMAX) return true;

    return gs_navi_data[x][y] != 0;
}

